    <script>
        // 0.3초마다 .open과 .closed의 display 값을 번갈아가게 설정
        setInterval(() => {
            const openDiv = document.querySelector('.oepn');
            const closedDiv = document.querySelector('.closed');
            
            // 현재 display 상태에 따라 toggle
            if (openDiv.style.display === 'none') {
                openDiv.style.opacity = 'block';
                closedDiv.style.display = 'none';
            } else {
                openDiv.style.display = 'none';
                closedDiv.style.display = 'block';
            }
        }, 800);
    </script>
